import React from "react";
import { Link } from "react-router-dom";

const Navbar = () => {
  return (
    <div className="Nav_menu">
      <div className="links">
        <Switch>
          <Route path="/posts">
            <Post />
          </Route>
          <Route path="/signup">
            <SignUp />
          </Route>
        </Switch>
      </div>
    </div>
  );
};

export default Navbar;
